function About( props ) {

    const loc = useLocation();

    function display()
    {
      if( loc.pathname==="/About")
      {
        return <button>Click me </button>
      }
      else{
        return null
      }
    }

  return (
    <>
      <h1>About page and my age is {props.age}</h1>
      {display}
    </>
  );
}
export default About;
